import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

window.initReactApp = function(userType) {
  ReactDOM.render(
    <React.StrictMode>
      <App userType={userType} />
    </React.StrictMode>,
    document.getElementById('react-root')
  );
};
